import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../App.css';

//<div className='App-header'>
//<h1>Caíste, no me podés pedir nada. Todavía no funciono =)</h1>
//</div>
    /*  
    bombón con ganash
    tableta con cereales
    tableta con caramelo
    tableta con menta
    trufa con frutos del bosque
    minihuevitos blancos
    minihuevitos semiamargo
    minihuevitos leche
     */
const listado = {
    0: {
        nombre: 'Bombón con ganash',
        imagen: '',
        enlace: ''
    },
    1: {
        nombre: 'Tableta con cereales',
        imagen: '',
        enlace: ''
    }
}

const Componente = () => {
    Object.keys(listado).map((artesania) => {
        return (
            <div className='App-header'>
                <h1>{artesania.nombre}</h1>
                <img src={artesania.imagen} alt='imagen'/>
                <h1>Caíste, no me podés pedir nada. Todavía no funciono =)</h1>
            </div>
        )
    })
}

export const Pedido = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
